import React from "react";

const loginForm = ({
  handleLogin,
  username,
  setUsername,
  password,
  setPassword
}) => (
  <form onSubmit={handleLogin}>
    <div>
      Username:
      <input
        type="text"
        value={username}
        name="Username"
        onChange={({ target }) => setUsername(target.value)}
      />
    </div>

    <div>
      Password:
      <input
        type="password"
        value={password}
        name="Password"
        onChange={({ target }) => setPassword(target.value)}
      />
    </div>
    <button type="submit">Login</button>
    <br />
    <br />
  </form>
);

export default Login;
